import $ from 'jquery';

export async function loadPosts() {
    return fetch('https://vibin-backend.herokuapp.com/api/posts', {
        headers: {
            'Access-Control-Allow-Origin' : '*',
            'Content-Type' : 'application/x-www-form-urlencoded'
        },
        method: 'GET',
    }).then(d => d.json());
}

export async function submitPost(token) {
    const requestOptions = {
        method: 'POST',
        headers: { 'Content-Type' : 'application/x-www-form-urlencoded' },
        body: { 
            name: 'Cole',
            text: 'React POST Request Example',
            songId: '7AQim7LbvFVZJE3O8TYgf2',
            songName: 'Fuck Love',
            songArtist: 'XXX',
            startTime: '90000',
            stopTime: '121000',
        }
    };
    fetch('http://vibin-backend.herokuapp.com/api/newPost', requestOptions)
        .then(response => response.json())
        .then(data => console.log(data));
}
